				break;
			case 17:
				$this->setOver($value);
				break;
			case 18:
				$this->setShort($value);
				break;
			case 19:
				$this->setTerminal($value);
				break;
			case 20:
				$this->setCashier($value);
				break;
			case 21:
				$this->setType($value);
				break;
			case 22:
				$this->setRemarks($value);
				break;
			case 23:
				$this->setUpdatedAt($value);
				break;
			case 24:
				$this->setCreatedAt($value);
				break;
		} // switch()
	}

	/**
