	 * This is particularly useful when populating an object from one of the
	 * request arrays (e.g. $_POST).  This method goes through the column
	 * names, checking to see whether a matching key exists in populated
	 * array. If so the setByName() method is called for that column.
	 *
	 * You can specify the key type of the array by additionally passing one
	 * of the class type constants BasePeer::TYPE_PHPNAME, BasePeer::TYPE_STUDLYPHPNAME,
	 * BasePeer::TYPE_COLNAME, BasePeer::TYPE_FIELDNAME, BasePeer::TYPE_NUM.
	 * The default key type is the column's phpname (e.g. 'AuthorId')
	 *
	 * @param      array  $arr     An array to populate the object from.
	 * @param      string $keyType The type of keys the array uses.
	 * @return     void
	 */
	public function fromArray($arr, $keyType = BasePeer::TYPE_PHPNAME)
	{
		$keys = CashcountPeer::getFieldNames($keyType);

		if (array_key_exists($keys[0], $arr)) $this->setId($arr[$keys[0]]);
		if (array_key_exists($keys[1], $arr)) $this->setDate($arr[$keys[1]]);
		if (array_key_exists($keys[2], $arr)) $this->setOneth($arr[$keys[2]]);
		if (array_key_exists($keys[3], $arr)) $this->setFiveh($arr[$keys[3]]);
		if (array_key_exists($keys[4], $arr)) $this->setTwoh($arr[$keys[4]]);
		if (array_key_exists($keys[5], $arr)) $this->setOneh($arr[$keys[5]]);
		if (array_key_exists($keys[6], $arr)) $this->setFifty($arr[$keys[6]]);
		if (array_key_exists($keys[7], $arr)) $this->setTwenty($arr[$keys[7]]);
		if (array_key_exists($keys[8], $arr)) $this->setTen($arr[$keys[8]]);
		if (array_key_exists($keys[9], $arr)) $this->setFive($arr[$keys[9]]);
		if (array_key_exists($keys[10], $arr)) $this->setOne($arr[$keys[10]]);
		if (array_key_exists($keys[11], $arr)) $this->setFiftyc($arr[$keys[11]]);
		if (array_key_exists($keys[12], $arr)) $this->setTwentyfivec($arr[$keys[12]]);
		if (array_key_exists($keys[13], $arr)) $this->setTenc($arr[$keys[13]]);
		if (array_key_exists($keys[14], $arr)) $this->setFivec($arr[$keys[14]]);
		if (array_key_exists($keys[15], $arr)) $this->setAmount($arr[$keys[15]]);
		if (array_key_exists($keys[16], $arr)) $this->setTotal($arr[$keys[16]]);
		if (array_key_exists($keys[17], $arr)) $this->setOver($arr[$keys[17]]);
		if (array_key_exists($keys[18], $arr)) $this->setShort($arr[$keys[18]]);
		if (array_key_exists($keys[19], $arr)) $this->setTerminal($arr[$keys[19]]);
		if (array_key_exists($keys[20], $arr)) $this->setCashier($arr[$keys[20]]);
		if (array_key_exists($keys[21], $arr)) $this->setType($arr[$keys[21]]);
		if (array_key_exists($keys[22], $arr)) $this->setRemarks($arr[$keys[22]]);
		if (array_key_exists($keys[23], $arr)) $this->setUpdatedAt($arr[$keys[23]]);
		if (array_key_exists($keys[24], $arr)) $this->setCreatedAt($arr[$keys[24]]);
	}

	/**
	 * Build a Criteria object containing the values of all modified columns in this object.
	 *
	 * @return     Criteria The Criteria object containing all modified values.
	 */
	public function buildCriteria()
	{
		$criteria = new Criteria(CashcountPeer::DATABASE_NAME);

		if ($this->isColumnModified(CashcountPeer::ID)) $criteria->add(CashcountPeer::ID, $this->id);
		if ($this->isColumnModified(CashcountPeer::DATE)) $criteria->add(CashcountPeer::DATE, $this->date);
		if ($this->isColumnModified(CashcountPeer::ONETH)) $criteria->add(CashcountPeer::ONETH, $this->oneth);
		if ($this->isColumnModified(CashcountPeer::FIVEH)) $criteria->add(CashcountPeer::FIVEH, $this->fiveh);
		if ($this->isColumnModified(CashcountPeer::TWOH)) $criteria->add(CashcountPeer::TWOH, $this->twoh);
		if ($this->isColumnModified(CashcountPeer::ONEH)) $criteria->add(CashcountPeer::ONEH, $this->oneh);
		if ($this->isColumnModified(CashcountPeer::FIFTY)) $criteria->add(CashcountPeer::FIFTY, $this->fifty);
		if ($this->isColumnModified(CashcountPeer::TWENTY)) $criteria->add(CashcountPeer::TWENTY, $this->twenty);
		if ($this->isColumnModified(CashcountPeer::TEN)) $criteria->add(CashcountPeer::TEN, $this->ten);
		if ($this->isColumnModified(CashcountPeer::FIVE)) $criteria->add(CashcountPeer::FIVE, $this->five);
		if ($this->isColumnModified(CashcountPeer::ONE)) $criteria->add(CashcountPeer::ONE, $this->one);
		if ($this->isColumnModified(CashcountPeer::FIFTYC)) $criteria->add(CashcountPeer::FIFTYC, $this->fiftyc);
		if ($this->isColumnModified(CashcountPeer::TWENTYFIVEC)) $criteria->add(CashcountPeer::TWENTYFIVEC, $this->twentyfivec);
		if ($this->isColumnModified(CashcountPeer::TENC)) $criteria->add(CashcountPeer::TENC, $this->tenc);
		if ($this->isColumnModified(CashcountPeer::FIVEC)) $criteria->add(CashcountPeer::FIVEC, $this->fivec);
		if ($this->isColumnModified(CashcountPeer::AMOUNT)) $criteria->add(CashcountPeer::AMOUNT, $this->amount);
		if ($this->isColumnModified(CashcountPeer::TOTAL)) $criteria->add(CashcountPeer::TOTAL, $this->total);
		if ($this->isColumnModified(CashcountPeer::OVER)) $criteria->add(CashcountPeer::OVER, $this->over);
		if ($this->isColumnModified(CashcountPeer::SHORT)) $criteria->add(CashcountPeer::SHORT, $this->short);
		if ($this->isColumnModified(CashcountPeer::TERMINAL)) $criteria->add(CashcountPeer::TERMINAL, $this->terminal);
		if ($this->isColumnModified(CashcountPeer::CASHIER)) $criteria->add(CashcountPeer::CASHIER, $this->cashier);
		if ($this->isColumnModified(CashcountPeer::TYPE)) $criteria->add(CashcountPeer::TYPE, $this->type);
		if ($this->isColumnModified(CashcountPeer::REMARKS)) $criteria->add(CashcountPeer::REMARKS, $this->remarks);
		if ($this->isColumnModified(CashcountPeer::UPDATED_AT)) $criteria->add(CashcountPeer::UPDATED_AT, $this->updated_at);
		if ($this->isColumnModified(CashcountPeer::CREATED_AT)) $criteria->add(CashcountPeer::CREATED_AT, $this->created_at);

		return $criteria;
	}

	/**
	 * Builds a Criteria object containing the primary key for this object.
	 *
	 * Unlike buildCriteria() this method includes the primary key values regardless
	 * of whether or not they have been modified.
	 *
	 * @return     Criteria The Criteria object containing value(s) for primary key(s).
	 */
	public function buildPkeyCriteria()
	{
		$criteria = new Criteria(CashcountPeer::DATABASE_NAME);

		$criteria->add(CashcountPeer::ID, $this->id);

		return $criteria;
	}

